import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import styles from '../scss/components/Login.css'
const Login = () => {
  return (
    <View style={styles.container}>
      <Text>This is My Page!</Text>
    </View>
  );
};


export default Login;
